import sys
input = sys.stdin.readline

class Trie:
    def __init__(self, val=0):
        self.val = val
        self.root = Trie(val)
        self.s = set()
        self.s.add(val)

    def add(self, val):
        if val == self.val:
            self.s.add(val)
            return
        else:
            self.root.add(val)
            return

def dfs(root, s):
    if root == None:
        return
    if root.s:
        return
    for i in range(len(s)):
        if s[i] == root.s[i-1]:
            root.s.pop(i)
        else:
            root.s.pop(i)
    root.s.add(root.val)
    return

def main():
    t = Trie()
    t.add(1)
    t.add(2)
    t.add(3)
    print(dfs(t))

