class Solution:
     def minPathSum(self, grid):
         """
         :type grid: List[List[int]]
         :rtype: int
         """
         m, n = len(grid), len(grid[0])
         dp = [[0] * n for _ in range(m)]

         for i in range(m):
             for j in range(n):
                 if grid[i][j] == 0:
                     dp[i][j] = 0
                 elif grid[i][j] == 1:
                     dp[i][j] = min(dp[i-1][j-1] + dp[i-1][j], dp[i][j-1] + dp[i-1][j-1])
